CREATE TABLE DIVIDENDOS (CODPAPEL NVARCHAR(6), TIPO NVARCHAR(MAX),DATACOM SMALLDATETIME,PAGAMENTO SMALLDATETIME,VALOR MONEY,OBS NVARCHAR(MAX))

DROP TABLE DIVIDENDOS

DELETE FROM DIVIDENDOS
SELECT * FROM DIVIDENDOS WHERE CODPAPEL = 'AESB3'

SELECT CODPAPEL,YEAR(PAGAMENTO),SUM(VALOR) FROM DIVIDENDOS GROUP BY CODPAPEL,YEAR(PAGAMENTO)
ORDER BY  CODPAPEL,YEAR(PAGAMENTO)

SELECT CODPAPEL,YEAR(PAGAMENTO),SUM(VALOR) FROM DIVIDENDOS
WHERE YEAR(PAGAMENTO) = '2019'
GROUP BY CODPAPEL,YEAR(PAGAMENTO)
ORDER BY sum(valor)






select t0.codpapel, Ano2014, Ano2015, Ano2016, Ano2017, Ano2018, Ano2019, Ano2020, Ano2021 from

(SELECT codpapel
FROM DIVIDENDOS 
group by codpapel 
) as t0

left join 

(SELECT codpapel, sum(valor) as 'Ano2014' 
FROM DIVIDENDOS where YEAR(PAGAMENTO) = 2014
group by codpapel 
) as t2014

on (t0.codpapel = t2014.codpapel)

left join 

(SELECT codpapel, sum(valor) as 'Ano2015' 
FROM DIVIDENDOS where YEAR(PAGAMENTO) = 2015
group by codpapel 
) as t2015

on (t0.codpapel = t2015.codpapel)


left join 

(SELECT codpapel, sum(valor) as 'Ano2016' 
FROM DIVIDENDOS where YEAR(PAGAMENTO) = 2016
group by codpapel 
) as t2016

on (t0.codpapel = t2016.codpapel)

left join 

(SELECT codpapel, sum(valor) as 'Ano2017' 
FROM DIVIDENDOS where YEAR(PAGAMENTO) = 2017
group by codpapel 
) as t2017

on (t0.codpapel = t2017.codpapel)

left join 

(SELECT codpapel, sum(valor) as 'Ano2018' 
FROM DIVIDENDOS where YEAR(PAGAMENTO) = 2018
group by codpapel 
) as t2018

on (t0.codpapel = t2018.codpapel)

left join 

(SELECT codpapel, sum(valor) as 'Ano2019' 
FROM DIVIDENDOS where YEAR(PAGAMENTO) = 2019
group by codpapel 
) as t2019

on (t0.codpapel = t2019.codpapel)

left join 

(SELECT codpapel, sum(valor) as 'Ano2020' 
FROM DIVIDENDOS where YEAR(PAGAMENTO) = 2020
group by codpapel 
) as t2020

on (t0.codpapel = t2020.codpapel)

left join 

(SELECT codpapel, sum(valor) as 'Ano2021' 
FROM DIVIDENDOS where YEAR(PAGAMENTO) = 2021
group by codpapel 
) as t2021

on (t0.codpapel = t2021.codpapel)


order by t0.codpapel  asc

















